contract CarisToken is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    string private _name = "CARIS-H";
    string private _symbol = "CST";
    uint8 private _decimals = 18;

    mapping(address => uint256) _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    mapping(address => bool) private _isExcludedFromFee;

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;

    uint256 private _totalSupply = 1000000000000 * 10 ** _decimals;

    uint256 public _sellTax = 7; // 7% of sell tax to be burnt
    uint256 private _previousSellTax = _sellTax;

    uint256 public _repurchaseFee = 2; // 2% repurchase tax
    uint256 private _previousRepurchaseFee = _repurchaseFee;

    uint256 public _marketingFee = 2; // 2% marketing tax
    uint256 private _previousMarketingFee = _marketingFee;

    uint256 public _developmentFee = 1; // 1% dev tax
    uint256 private _previousDevelopmentFee = _developmentFee;

    uint256 public _charityFee = 4; // 4% charity tax
    uint256 private _previousCharityFee = _charityFee;

    address private _developmentAddress =
        0xEf13cc07da74A8b7BC6FEbcb8f21d676B2281471;
    address private _marketingAddress =
        0xEf13cc07da74A8b7BC6FEbcb8f21d676B2281471;
    address private _repurchaseFeeAddress =
        0xEf13cc07da74A8b7BC6FEbcb8f21d676B2281471;
    address private _charityAddress =
        0xEf13cc07da74A8b7BC6FEbcb8f21d676B2281471;

    constructor() {
        // IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
        //     0xD99D1c33F9fC3444f8101754aBC46c52416550D1
        // );
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());

        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;
        _isExcludedFromFee[_developmentAddress] = true;
        _isExcludedFromFee[_marketingAddress] = true;
        _isExcludedFromFee[_charityAddress] = true;
        _isExcludedFromFee[_repurchaseFeeAddress] = true;

        _balances[_msgSender()] = _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    receive() external payable {}

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function allowance(
        address owner,
        address spender
    ) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function increaseAllowance(
        address spender,
        uint256 addedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(
        address spender,
        uint256 subtractedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function approve(
        address spender,
        uint256 amount
    ) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFromFee[account];
    }

    function setIsExcludedFromFee(
        address account,
        bool newValue
    ) public onlyOwner {
        _isExcludedFromFee[account] = newValue;
    }

    function setFee(
        uint256 repurchaseFee,
        uint256 marketingFee,
        uint256 developmentFee,
        uint256 charityFee
    ) public onlyOwner {
        require(
            repurchaseFee + marketingFee + developmentFee + charityFee <= 25,
            "Total fee is over 25%"
        );
        _repurchaseFee = repurchaseFee;
        _marketingFee = marketingFee;
        _developmentFee = developmentFee;
        _charityFee = charityFee;
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) private returns (bool) {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        bool takeFee = true;

        if (_isExcludedFromFee[sender] || _isExcludedFromFee[recipient]) {
            takeFee = false;
        }

        _tokenTransfer(sender, recipient, amount, takeFee);

        return true;
    }

    function _tokenTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool takeFee
    ) private {
        if (!takeFee) removeAllFee();

        _balances[sender] = _balances[sender].sub(
            amount,
            "Insufficient Balance"
        );

        uint256 finalAmount = takeAllFee(sender, recipient, amount);
        _increaseBalance(sender, recipient, finalAmount);

        if (!takeFee) restoreAllFee();
    }

    function _increaseBalance(address sender, address recipient, uint256 _amount) internal {
        _balances[recipient] = _balances[recipient].add(_amount);
        emit Transfer(sender, recipient, _amount);
    }

    function takeAllFee(
        address sender,
        address recipient,
        uint256 amount
    ) internal returns (uint256) {
        uint256 newAmount = amount;

        if (recipient == uniswapV2Pair && sender != address(uniswapV2Router)) {
            if (_sellTax > 0) {
                uint256 sellTaxAmount = calcFee(amount, _sellTax);
                newAmount -= sellTaxAmount;

                _increaseBalance(sender, address(0), sellTaxAmount);
            }
        }

        uint256 repurchaseFee = calcFee(amount, _repurchaseFee);
        uint256 marketingFee = calcFee(amount, _marketingFee);
        uint256 developmentFee = calcFee(amount, _developmentFee);
        uint256 charityFee = calcFee(amount, _charityFee);

        newAmount -= repurchaseFee + marketingFee + developmentFee + charityFee;

        if (repurchaseFee > 0) {
            _increaseBalance(sender, _repurchaseFeeAddress, repurchaseFee);
        }
        if (marketingFee > 0) {
            _increaseBalance(sender, _marketingAddress, marketingFee);
        }
        if (developmentFee > 0) {
            _increaseBalance(sender, _developmentAddress, developmentFee);
        }
        if (charityFee > 0) {
            _increaseBalance(sender, _charityAddress, charityFee);
        }

        return newAmount;
    }

    function removeAllFee() private {
        if (
            _sellTax == 0 &&
            _repurchaseFee == 0 &&
            _marketingFee == 0 &&
            _developmentFee == 0 &&
            _charityFee == 0
        ) return;

        _previousSellTax = _sellTax;
        _previousRepurchaseFee = _repurchaseFee;
        _previousMarketingFee = _marketingFee;
        _previousDevelopmentFee = _developmentFee;
        _previousCharityFee = _charityFee;

        _sellTax = 0;
        _repurchaseFee = 0;
        _marketingFee = 0;
        _developmentFee = 0;
        _charityFee = 0;
    }

    function restoreAllFee() private {
        _sellTax = _previousSellTax;
        _repurchaseFee = _previousRepurchaseFee;
        _marketingFee = _previousMarketingFee;
        _developmentFee = _previousDevelopmentFee;
        _charityFee = _previousCharityFee;
    }

    function calcFee(
        uint256 _amount,
        uint256 _fee
    ) internal pure returns (uint256) {
        return _amount.mul(_fee).div(100);
    }

    event MarketingAddressUpdated(address indexed previous, address indexed adr);
    function setNewMarketingAddress(address markt) public onlyOwner() {
        emit MarketingAddressUpdated(_marketingAddress, markt);	
        _marketingAddress = markt;
        _isExcludedFromFee[_marketingAddress] = true;
    }

    event DevAddressUpdated(address indexed previous, address indexed adr);
    function setNewDevAddress(address dev) public onlyOwner() {
        emit DevAddressUpdated(_developmentAddress, dev);	
        _developmentAddress = dev;
        _isExcludedFromFee[_developmentAddress] = true;
    }

    event CharityAddressUpdated(address indexed previous, address indexed adr);
    function setNewCharityAddress(address charityAdd) public onlyOwner() {
        emit CharityAddressUpdated(_charityAddress, charityAdd);	
        _charityAddress = charityAdd;
        _isExcludedFromFee[_charityAddress] = true;
    }

    event RepurchaseAddressUpdated(address indexed previous, address indexed adr);
    function setNewRepurchaseAddress(address repurchAdd) public onlyOwner() {
        emit RepurchaseAddressUpdated(_repurchaseFeeAddress, repurchAdd);	
        _repurchaseFeeAddress = repurchAdd;
        _isExcludedFromFee[_repurchaseFeeAddress] = true;
    }
}
